import { React, useEffect, useState } from "react";
import Card from "../../components/Card";
import search from "../../assets/icons/search.svg";
const ExplorePage = () => {
  const [houseData, setHouseData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:3001/house/")
      .then((res) => res.json())
      .then((json) => {
        console.log("json", json);
        setHouseData(json["houses"]);
        console.log("houseVar", houseData);
      })
      .catch((err) => {
        console.log("error", err);
      });
  }, []);
  return (
    <>
      <div className="filterhandles">
        <div className="leftFilters">
          <div className="search">
            <input
              type="text"
              className="hpsearch"
              placeholder="Enter a location"
            />
            <button className="searchbtn">
              <img src={search} alt="" />
            </button>
          </div>

          <select name="PriceRange" id="" className="hpDropDowns">
            <option value="">Price Range</option>
            <option value="">&lt; 5000</option>
            <option value="">&gt; 5000 - &lt; 10000</option>
            <option value="">&gt; 10000 - &lt; 15000</option>
            <option value="">&gt; 15000 - &lt; 30000 </option>
            <option value="">&gt; 30000 </option>
          </select>
          <select name="forPerson" id="" className="hpDropDowns">
            <option value="">For</option>
            <option value="">&lt; 5000</option>
            <option value="">&gt; 5000 - &lt; 10000</option>
            <option value="">&gt; 10000 - &lt; 15000</option>
            <option value="">&gt; 15000 - &lt; 30000 </option>
            <option value="">&gt; 30000 </option>
          </select>
        </div>
        <div className="rightFilters"></div>
      </div>
      <div className="searchResults">
        <div className="searchResultInnerDiv">
          {houseData
            ? houseData.map((house, index) => (
                <Card
                  houseInfo={house}
                  // location={house.location.area}
                  // image={house.image_path[0]}
                />
              ))
            : null}
        </div>
      </div>
    </>
  );
};

export default ExplorePage;
